INSERT INTO "public"."customizations" (id,application_id,customization_tosca_file,customization_creation,customization_activation,customization_decommission,status_id,username,process_id) VALUES (1,1,'<?xml version="1.0" encoding="UTF-8"?>\n<Definitions id="ClearoDef"\n	name=""\n	targetNamespace="http://tempuri.org"\n	xmlns="http://docs.oasis-open.org/tosca/ns/2011/12"\n	xmlns:co="http://docs.oasis-open.org/tosca/ns/2011/12/CloudOptingTypes"\n	xmlns:xml="http://www.w3.org/XML/1998/namespace"\n	xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance"\n	xsi:schemaLocation="http://docs.oasis-open.org/tosca/ns/2011/12 ../Types/TOSCA-v1.0.xsd http://docs.oasis-open.org/tosca/ns/2011/12/CloudOptingTypes\n		../Types/CloudOptingTypes.xsd">\n	<NodeType name="VMhost">\n		<documentation>\n			This is the VM description, we need to collect the SLA information (that is the set\n			of CPU+RAM+DISK) that the VM need to have for the service (this information is\n			just a label for the end user but translate to data for the system)\n		</documentation>\n		<PropertiesDefinition element="co:VMhostProperties" type="co:tVMhostProperties" />\n		<Interfaces>\n			<Interface name="http://tempuri.org">\n				<Operation name="Install">\n					<documentation>\n						The parameters to ask to the end user to execute the "install" operation of this node\n					</documentation>\n					<InputParameters>\n						<InputParameter name="co:SLA.co:Chosen" type="co:SLA" />\n					</InputParameters>\n				</Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="DockerContainer">\n		<documentation>\n			This is the Docker Container (the Docker host is already installed in the VM image)\n		</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="writePuppetDockerTemplateHierarchy"></Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="Apache">\n		<documentation>\n			This is the Apache server (we should not ask anything to the end user about apache,\n			but we need to set the properties)\n		</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="compilePuppetTemplateHierarchy"></Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="ApacheVirtualHost">\n		<documentation>This is the Apache Virtual Host and here we have things\n			to ask to the user</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="compilePuppetTemplateHierarchy"></Operation>\n			</Interface>\n			<Interface name="Config">\n				<Operation name="Install">\n					<InputParameters>\n						<InputParameter name="VHostName" type="xs:string" />\n					</InputParameters>\n				</Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="ApacheModule">\n		<documentation>This is the Apache Module and here we have things\n			to ask to the user</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="compilePuppetTemplateHierarchy"></Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="MySQL">\n		<documentation>This is the MySQL engine</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="compilePuppetTemplateHierarchy"></Operation>\n			</Interface>\n			<Interface name="Config">\n				<Operation name="Install">\n					<InputParameters>\n						<InputParameter name="root_password" type="xs:string" />\n					</InputParameters>\n				</Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="MySQLDatabase">\n		<documentation>This is the MySQL DB</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="compilePuppetTemplateHierarchy"></Operation>\n			</Interface>\n			<Interface name="Config">\n				<Operation name="Install">\n					<InputParameters>\n						<InputParameter name="dbPassword" type="xs:string" />\n					</InputParameters>\n				</Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="PostgreSQL">\n		<documentation>This is the PostgreSQL engine</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="compilePuppetTemplateHierarchy"></Operation>\n			</Interface>\n			<Interface name="Config">\n				<Operation name="Install">\n					<InputParameters>\n						<InputParameter name="postgres_password" type="xs:string" />\n					</InputParameters>\n				</Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="PostgreSQLDatabase">\n		<documentation>This is the PostgreSQL DB</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="compilePuppetTemplateHierarchy"></Operation>\n			</Interface>\n			<Interface name="Config">\n				<Operation name="Install">\n					<InputParameters>\n						<InputParameter name="dbPassword" type="xs:string" />\n					</InputParameters>\n				</Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="Tomcat">\n		<documentation>\n			This is the Tomcat server (we should not ask anything to the end user about tomcat,\n			but we need to set the properties)\n		</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="compilePuppetTemplateHierarchy"></Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="War">\n		<documentation>\n			This is the War component that can be deployed on a tomcat server\n		</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="compilePuppetTemplateHierarchy"></Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<NodeType name="WarApplication">\n		<documentation>\n			This is the WarApplication component that can be deployed on a tomcat server\n		</documentation>\n		<PropertiesDefinition element="a" type="a" />\n		<Interfaces>\n			<Interface name="Install">\n				<Operation name="compilePuppetTemplateHierarchy"></Operation>\n			</Interface>\n		</Interfaces>\n	</NodeType>\n	<ServiceTemplate id="Clearo" name="" substitutableNodeType="QName" targetNamespace="http://tempuri.org">\n		\n		<TopologyTemplate>\n			<documentation xml:lang="" source="http://tempuri.org" />\n			<NodeTemplate id="ClearoVM" maxInstances="1" minInstances="1" name="" type="VMhost">\n				<documentation xml:lang="" source="http://tempuri.org" />\n				<Properties>\n					<co:VMhostProperties>\n						<co:SLAsProperties>\n							<co:SLA Name="Big City" id="BigCity">\n								<co:NumCpus>2</co:NumCpus>\n								<co:Memory>2</co:Memory>\n								<co:Price>10000</co:Price>\n								<co:Disk>10</co:Disk>\n								<co:Chosen>false</co:Chosen>\n							</co:SLA>\n							<co:SLA Name="Small City" id="SmallCity">\n								<co:NumCpus>1</co:NumCpus>\n								<co:Memory>1</co:Memory>\n								<co:Price>5000</co:Price>\n								<co:Disk>5</co:Disk>\n								<co:Chosen>true</co:Chosen>\n							</co:SLA>\n							<co:SLA Name="Region" id="Region">\n								<co:NumCpus>4</co:NumCpus>\n								<co:Memory>4</co:Memory>\n								<co:Price>20000</co:Price>\n								<co:Disk>20</co:Disk>\n								<co:Chosen>false</co:Chosen>\n							</co:SLA>\n						</co:SLAsProperties>\n						<co:vmImage>sd</co:vmImage>\n						<co:VMports><co:VMport></co:VMport></co:VMports>\n					</co:VMhostProperties>\n				</Properties>\n			</NodeTemplate>\n			<NodeTemplate type="DockerContainer" id="ClearoApacheDC">\n				<Properties>\n					<co:DockerContainerProperties>\n						<co:from>centos:6.6</co:from>\n						<co:entrypoint>[ "/usr/sbin/httpd" ]</co:entrypoint>\n						<co:cmd>[ "-D", "FOREGROUND" ]</co:cmd>\n					</co:DockerContainerProperties>\n				</Properties>\n				<Capabilities><Capability id="p0" type="ports" name=""><Properties><co:ports host="80" container="80"></co:ports></Properties></Capability></Capabilities>\n				<DeploymentArtifacts>\n					<DeploymentArtifact name="ClearoApacheDC.dockerfile"\n						artifactType="DockerfileTemplate" artifactRef="DockerContainerDT0"></DeploymentArtifact>\n					<DeploymentArtifact name="ClearoApacheDC.pp"\n						artifactType="PuppetTemplate" artifactRef="DockerContainerPT0"></DeploymentArtifact>\n				</DeploymentArtifacts>\n			</NodeTemplate>\n			<NodeTemplate type="Apache" id="ClearoApache">\n				<Properties>\n					<co:ApacheProperties>\n						<co:default_mods>true</co:default_mods>\n						<co:default_vhost>false</co:default_vhost>\n						<co:servername>fqdn</co:servername>\n						<co:log_formats>{ vhost_common => ''%v %h %l %u %t \"%r\" %>s %b'' }</co:log_formats>\n					</co:ApacheProperties>\n				</Properties>\n				<Capabilities>\n					<Capability id="p01" type="portsExpose" name=""><Properties><co:port>80</co:port></Properties></Capability></Capabilities>\n				<DeploymentArtifacts>\n					<DeploymentArtifact name=""\n						artifactType="PuppetTemplate" artifactRef="ClearoApachePT"></DeploymentArtifact>\n				</DeploymentArtifacts>\n			</NodeTemplate>\n			<NodeTemplate type="ApacheVirtualHost" id="ClearoApacheVH">\n				<Properties>\n					<co:ApacheVirtualHostProperties>\n						<co:servername>www.clearo.com</co:servername>\n						<co:vhost_name>*</co:vhost_name>\n						<co:aliases></co:aliases>\n						<co:default_vhost>false</co:default_vhost>\n						<co:docroot>''/var/www/www.clearo.com''</co:docroot>\n						<co:directories>[ { path => ''/var/www/www.clearo.com'', addhandlers => [{ handler => ''cgi-script'', extensions\n							=> [''.cgi'']}], }, ]</co:directories>\n						<co:log_level></co:log_level>\n						<co:options>[''Indexes'',''FollowSymLinks'',''MultiViews'']</co:options>\n						<co:port>80</co:port>\n						<co:proxy_preserve_host>true</co:proxy_preserve_host> \n						<co:proxy_pass>[ { ''path'' => ''/'', ''url'' => ''ajp://ClearoTomcatDC:8009/'' }, ]</co:proxy_pass>\n						<co:redirect_source></co:redirect_source>\n						<co:redirect_dest></co:redirect_dest>\n						<co:redirect_status></co:redirect_status>\n						<co:rewrites></co:rewrites>\n						<co:setenv></co:setenv>\n						<co:ssl>false</co:ssl>\n						<co:serveradmin></co:serveradmin>\n					</co:ApacheVirtualHostProperties>\n				</Properties>\n				<DeploymentArtifacts>\n					<DeploymentArtifact name=""\n						artifactType="PuppetTemplate" artifactRef="ClearoApacheVHPT"></DeploymentArtifact>\n				</DeploymentArtifacts>\n			</NodeTemplate>\n			<NodeTemplate type="ApacheModule" id="ClearoApacheMod1">\n				<Properties>\n					<co:ApacheModuleProperties>\n						<co:module>proxy_ajp</co:module>\n						<co:settings></co:settings>\n					</co:ApacheModuleProperties>\n				</Properties>\n				<DeploymentArtifacts>\n					<DeploymentArtifact name=""\n						artifactType="PuppetTemplate" artifactRef="ClearoApacheMod1PT"></DeploymentArtifact>\n				</DeploymentArtifacts>\n			</NodeTemplate>\n			<NodeTemplate type="DockerContainer" id="ClearoPostgreSQLDC">\n				<Properties>\n					<co:DockerContainerProperties>\n						<co:from>centos:6.6</co:from>\n						<co:entrypoint></co:entrypoint>\n						<co:cmd>/etc/init.d/postgresql-9.3 start &amp;&amp; tail -F /var/lib/pgsql/9.3/pgstartup.log</co:cmd>\n					</co:DockerContainerProperties>\n				</Properties>\n				<DeploymentArtifacts>\n					<DeploymentArtifact name="ClearoPostgreSQLDC.dockerfile"\n						artifactType="DockerfileTemplate" artifactRef="DockerContainerDT0"></DeploymentArtifact>\n					<DeploymentArtifact name="ClearoPostgreSQLDC.pp"\n						artifactType="PuppetTemplate" artifactRef="DockerContainerPT0"></DeploymentArtifact>\n				</DeploymentArtifacts>\n			</NodeTemplate>\n			<NodeTemplate type="PostgreSQL" id="ClearoPostgreSQL">\n				<Properties>\n					<co:PostgreSQLProperties>\n						<co:postgres_password>''mypass''</co:postgres_password>\n						<co:listen_addresses>''*''</co:listen_addresses>\n						<co:datadir></co:datadir>\n						<co:version>9.3</co:version>\n						<co:ip_mask_allow_all_users>0.0.0.0/0</co:ip_mask_allow_all_users>\n						<co:log_filename>postgres.log</co:log_filename>\n					</co:PostgreSQLProperties>\n				</Properties>\n				<Capabilities><Capability id="p02" type="portsExpose" name=""><Properties><co:port>5432</co:port></Properties></Capability></Capabilities>\n				<DeploymentArtifacts>\n					<DeploymentArtifact name="ClearoPostgreSQL.pp"\n						artifactType="PuppetTemplate" artifactRef="ClearoPostgreSQLPT"></DeploymentArtifact>\n				</DeploymentArtifacts>\n			</NodeTemplate>\n			<NodeTemplate type="PostgreSQLDatabase" id="ClearoPostgreSQLDB">\n				<Properties>\n					<co:PostgreSQLDatabaseProperties>\n						<co:dbname>clearodb</co:dbname>\n						<co:user>clearoadmin</co:user>\n						<co:password>postgresql_password(''clearoadmin'',''clearoDBpass'')</co:password>\n						<co:connectionHost>\n						</co:connectionHost>\n						<co:grant></co:grant>\n						<co:sql>\n						</co:sql>\n						<co:import_timeout>\n						</co:import_timeout>\n						<co:charset>\n						</co:charset>\n						<co:collate>\n						</co:collate>\n					</co:PostgreSQLDatabaseProperties>\n				</Properties>\n				<DeploymentArtifacts>\n					<DeploymentArtifact name=""\n						artifactType="PuppetTemplate" artifactRef="ClearoPostgreSQLDBPT"></DeploymentArtifact>\n				</DeploymentArtifacts>\n			</NodeTemplate>\n			<NodeTemplate type="DockerContainer" id="ClearoTomcatDC">\n				<Properties>\n					<co:DockerContainerProperties>\n						<co:from>centos:6.6</co:from>\n						<co:entrypoint></co:entrypoint>\n						<co:cmd>/opt/liferay/tomcat7/bin/startup.sh &amp;&amp; tail -F /opt/liferay/tomcat7/logs/catalina.out</co:cmd>\n					</co:DockerContainerProperties>\n				</Properties>\n				<Capabilities><Capability id="p03" type="ports" name=""><Properties><co:ports host="8081" container="8080"><